    PROCEDURE log_error (
        p_raised_by IN VARCHAR2,
        p_errmsg    IN VARCHAR2
    ) AS
        PRAGMA autonomous_transaction;
    BEGIN
        INSERT INTO error_logs (
            raised_by,
            error_message
        ) VALUES (
            p_raised_by,
            p_errmsg
        );

        COMMIT;
    END log_error;

